  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata describes the digital orthoimagery
  covering Orange County, FL. This orthoimagery was collected under contract to the
  Orange County Property Appraiser and subsequently reformatted to the FL Department
  of Revenue specifications. This 1\"=100'scale imagery is comprised of natural color
  orthoimagery with a GSD (Ground Sample Distance) of 0.5. Imagery was collected with
  the Leica ADS40 digital sensor and processed with Leica GPro software. Imagery is
  projected in State Plane Coordinate System, Florida East using the Transverse Mercator
  map projection parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
